            <p class=""jura__text"">Wyżyna Krakowsko–Częstochowska nazywana jest także Jurą Krakowsko–Częstochowską, Jurą Krakowską bądź Jurą. Zlokalizowana jest w zachodniej części Małopolski przy granicy z Województwem Śląskim (patrz mapa - link na końcu artykułu)*. Tworzy między Krakowem a Częstochową pas o długości ok 80 km2 i powierzchni 2615 km2. Jej głównym wyróżnikiem są ciekawe nawet kilkudziesięciometrowe formacje, ostańce i jaskinie wapienno – skalne porozrzucane po całym makroregionie. Ich obecność Jura zawdzięcza zlokalizowanemu tu niegdyś morzu. Jura Krakowsko–Częstochowska słynie także z sieci średniowiecznych zamków (Orlich Gniazd), które miały za zadanie strzec Królestwa Polskiego na granicy z Górnym Śląskiem. </p>
