  ");
            WriteLiteral(@"      <h2 class=""jura__header"">Bogactwo geologiczne</h2>
        <div class=""jura__container"">
            <p class=""jura__text"">Utworami geologicznymi odsłaniającymi się w rejonie Ojcowskiego Parku Narodowego są wapienie górnojurajskie, osiągające ok. 200 m miąższości, powstałe z nagromadzenia ogromnej ilości szczątków organizmów, które żyły w morzu jurajskim ok. 150 mln lat temu. Barwa ich jest z reguły biała, jasnożółta lub jasnoszara. W okolicach Ojcowa występują dwa typy wapieni - skaliste i ławicowe. Formy skałkowe zbudowane są głównie z wapieni skalistych, wyróżniających się dużą twardością, zwięzłością, spękaniami ciosowymi i brakiem krzemieni. Spośród skamieniałości najczęściej można spotkać gąbki. Tereny położone między skałkami zbudowane są z wapieni ławicowych o różnej grubości ławic, litologicznie zbliżonych do skalistych, różniących się od nich wyraźnym warstwowaniem i obecnością buł krzemiennych. Wśród skamieniałości występują ramienionogi i bardzo rzadko amonity. W rzeźbie Ojcowskiego Parku ");
